import React from 'react';

const SuperItemAdded = React.memo(() => {

    //id	firstName	lastName	email	phone	address	description

    return <div>
        <button>Add item in table</button>
        <table>
            <tr><td>id</td><td><input /></td></tr>
            <tr><td>firstName</td><td><input /></td></tr>
            <tr><td>lastName</td><td><input /></td></tr>
            <tr><td>email</td><td><input /></td></tr>
            <tr><td>phone</td><td><input /></td></tr>
            <tr><td>address</td><td><input /></td></tr>
            <tr><td>description</td><td><input /></td></tr>
        </table>
    </div>
});

export default SuperItemAdded;
